import { getHostName } from "../../../BrandContext/BrandContextProvider";

export default function Redirect(): string {
    return getHostName().hostname.includes("local")
        ? "https://ti.submarinoviagens.com.br/mytravels/reservations"
        : `https://${getHostName().hostname}`;
}
